import string


def is_isomorphic(s, t):
    listS = list(s)
    listT = list(t)
    if len(listS) != len(listT):
        return False
    char_left = list(string.ascii_letters) + list(string.punctuation) + list(string.digits)
    final_lst = []
    char_used = []
    char_dict = {}
    for num_char in range(len(listS)):
        found_letter = False
        if listS[num_char] in char_used:
            final_lst.append(char_dict[listS[num_char]])
            found_letter = True
        for letter in char_left:
            if listT[num_char] == letter:
                char_left.remove(letter)
                char_used.append(listS[num_char])
                char_dict[listS[num_char]] = letter
                final_lst.append(letter)
                found_letter = True
                break
        if not found_letter:
            return False

    return listT == final_lst


